import React from 'react';

import { Panel, PanelHeader, Header, Group } from '@vkontakte/vkui';

const Home = () => (
	<Panel>
		<PanelHeader>Таблица Шульте</PanelHeader>
		<Group mode="plain" header={<Header mode="secondary">С внутренней обводкой</Header>}>
			<CardGrid size="l">
				<Card mode="outline">
					<div style={{ height: 96 }} />
				</Card>
			</CardGrid>
		</Group>

	</Panel>
);



export default Home;
